import React from 'react';

function Card({ title, subtitle, alt, src }) {
  return (
    <li className="element">
    <img className="element__image" alt={alt} srs={src} />
    <button className="element__trash-button" aria-label="Удаление элемента" type="button"></button>
    <div className="element__description">
      <h2 className="element__name">{title}</h2>
      <div className="element__like">
        <button
          className="element__like-button"
          aria-label="Выбор понравившегося элемента"
          type="button"
        ></button>
        {/* <h3 className="element__like-amount">{likes}</h3> */}
      </div>
    </div>
  </li>
  );
}

export default Card;
